drive = GoogleDrive(self.ga)
flist = drive.ListFile({'q': "title = '%s' and trashed = false" % self.
    title, 'maxResults': 2})
files = []
for x in flist:
    self.assertTrue(len(x) <= 2)
    files.extend(x)
for file1 in self.file_list:
    found = False
    for file2 in files:
        if file1['id'] == file2['id']:
            found = True
    self.assertEqual(found, True)
